import React from "react";
import Maching from "./Maching";
import Notmaching from "./NotMaching";


const Slot = (props) => {
    let x = props.x;
    let y = props.y;
    let z = props.z;

    return (( (x===y) && (y===z) ) ? <Maching /> : <Notmaching/>) 
    
     
}

export default Slot;
